import{_ as t,c as n,o as r,ae as i}from"./chunks/framework.DlU1FK7t.js";const u=JSON.parse('{"title":"Visualizations of deep mutational scanning on envelope protein structures","description":"","frontmatter":{"aside":false},"headers":[],"relativePath":"structures.md","filePath":"structures.md"}'),a={name:"structures.md"};function s(o,e,c,l,m,d){return r(),n("div",null,e[0]||(e[0]=[i('<h1 id="visualizations-of-deep-mutational-scanning-on-envelope-protein-structures" tabindex="-1">Visualizations of deep mutational scanning on envelope protein structures <a class="header-anchor" href="#visualizations-of-deep-mutational-scanning-on-envelope-protein-structures" aria-label="Permalink to &quot;Visualizations of deep mutational scanning on envelope protein structures&quot;">​</a></h1><p>This provides access to the effects of mutations mapped onto three-dimensional structures of the envelope proteins, as rendered by <a href="https://dms-viz.github.io/dms-viz-docs/" target="_blank" rel="noreferrer">dms-viz</a>.</p><p>It uses two structures, both from <a href="https://pubmed.ncbi.nlm.nih.gov/31080061/" target="_blank" rel="noreferrer">this paper</a>, that are cryo-EM structures of the CHIKV envelope proteins bound to mouse Mxra8. In both structures, there are four envelope heteromers (E2 / E1 or E3 / E2 / E1) in the asymmetric unit even though envelop actually forms a trimer. Note that <a href="https://pubmed.ncbi.nlm.nih.gov/31080061/" target="_blank" rel="noreferrer">as described in the paper</a>, Mxra8 contacts E2 / E1 in three different modes: wrapped, intraspike, and interspike. The structures are:</p><ul><li><a href="https://www.rcsb.org/structure/6NK7" target="_blank" rel="noreferrer">PDB ID 6nk7</a>: E3 / E2 / E1 on CHIKV bound to one copy of mouse Mxra8</li><li><a href="https://www.rcsb.org/structure/6NK6" target="_blank" rel="noreferrer">PDB ID 6nk6</a>: E2 / E1 on CHIKV virus-like particles bound to four copies of mouse Mxra8.</li></ul><p>Note that all of the <a href="https://dms-viz.github.io/dms-viz-docs/" target="_blank" rel="noreferrer">dms-viz</a> visualizations are interactive, and allow you to click on sites in the line plot to show them on the envelope proteins structure, as well as various other interactive options. In all of the structures below, the envelope proteins are initially gray while Mxra8 is shown in yellow; clicking on a site in the line plot will color it on the envelope protein structure based on its measured effect:</p><nav class="table-of-contents"><ul><li><a href="#effects-of-mutations-on-cell-entry">Effects of mutations on cell entry</a></li><li><a href="#differences-in-effects-of-mutations-on-entry-in-different-cells">Differences in effects of mutations on entry in different cells</a></li><li><a href="#effects-of-mutations-on-mxra8-binding">Effects of mutations on Mxra8 binding</a></li></ul></nav><h2 id="effects-of-mutations-on-cell-entry" tabindex="-1">Effects of mutations on cell entry <a class="header-anchor" href="#effects-of-mutations-on-cell-entry" aria-label="Permalink to &quot;Effects of mutations on cell entry&quot;">​</a></h2><p>Below is a visualization of the effects of mutations on cell entry on the trimer in <code>6nk7</code>. Click on the <em>Sidebar</em> and <em>Chart Options</em> to select which cell line to show entry for; click on the line plot to highlight sites on the structure. To view it in a standalone page (which may be easier to interact with), click <a href="https://dms-viz.github.io/v0/?data=https%3A%2F%2Fraw.githubusercontent.com%2Fdms-vep%2FCHIKV-181-25-E-DMS%2Frefs%2Fheads%2Fmain%2Fresults%2Fdms-viz%2Fcell_entry_on_6nk7_trimer%2Fcell_entry_on_6nk7_trimer.json&amp;ce=%255B%2522entry%2520in%2520293T_Mxra8%2520cells%2522%255D&amp;bc=%23d2cd32" target="_blank" rel="noreferrer">here</a>.</p><iframe src="https://dms-viz.github.io/v0/?data=https%3A%2F%2Fraw.githubusercontent.com%2Fdms-vep%2FCHIKV-181-25-E-DMS%2Frefs%2Fheads%2Fmain%2Fresults%2Fdms-viz%2Fcell_entry_on_6nk7_trimer%2Fcell_entry_on_6nk7_trimer.json&amp;ce=%255B%2522entry%2520in%2520293T_Mxra8%2520cells%2522%255D&amp;bc=%23d2cd32" width="100%" height="700px"></iframe><p>For additional visualizations, see:</p><ul><li><a href="https://dms-viz.github.io/v0/?data=https%3A%2F%2Fraw.githubusercontent.com%2Fdms-vep%2FCHIKV-181-25-E-DMS%2Frefs%2Fheads%2Fmain%2Fresults%2Fdms-viz%2Fcell_entry_on_6nk7_asymmetric_unit%2Fcell_entry_on_6nk7_asymmetric_unit.json&amp;ce=%255B%2522entry%2520in%2520293T_Mxra8%2520cells%2522%255D&amp;bc=%23c5bf2b" target="_blank" rel="noreferrer">Cell entry on the <code>6nk7</code> asymmetric unit</a></li><li><a href="https://dms-viz.github.io/v0/?data=https%3A%2F%2Fraw.githubusercontent.com%2Fdms-vep%2FCHIKV-181-25-E-DMS%2Frefs%2Fheads%2Fmain%2Fresults%2Fdms-viz%2Fcell_entry_on_6nk6_asymmetric_unit%2Fcell_entry_on_6nk6_asymmetric_unit.json&amp;ce=%255B%2522entry%2520in%2520293T_Mxra8%2520cells%2522%255D&amp;bc=%23c5bf2b" target="_blank" rel="noreferrer">Cell entry on the <code>6nk6</code> asymmetric unit</a></li><li><a href="https://dms-viz.github.io/v0/?data=https%3A%2F%2Fraw.githubusercontent.com%2Fdms-vep%2FCHIKV-181-25-E-DMS%2Frefs%2Fheads%2Fmain%2Fresults%2Fdms-viz%2Fcell_entry_on_6nk6_wrapped%2Fcell_entry_on_6nk6_wrapped.json&amp;bc=%23d1c32e&amp;ce=%255B%2522entry%2520in%2520293T_Mxra8%2520cells%2522%255D" target="_blank" rel="noreferrer">Cell entry on the <code>6nk6</code> structure showing wrapped contact mode</a></li><li><a href="https://dms-viz.github.io/v0/?data=https%3A%2F%2Fraw.githubusercontent.com%2Fdms-vep%2FCHIKV-181-25-E-DMS%2Frefs%2Fheads%2Fmain%2Fresults%2Fdms-viz%2Fcell_entry_on_6nk6_intraspike%2Fcell_entry_on_6nk6_intraspike.json&amp;bc=%23c8d331&amp;ce=%255B%2522entry%2520in%2520293T_Mxra8%2520cells%2522%255D" target="_blank" rel="noreferrer">Cell entry on the <code>6nk6</code> structure showing the intraspike contact mode</a></li><li><a href="https://dms-viz.github.io/v0/?data=https%3A%2F%2Fraw.githubusercontent.com%2Fdms-vep%2FCHIKV-181-25-E-DMS%2Frefs%2Fheads%2Fmain%2Fresults%2Fdms-viz%2Fcell_entry_on_6nk6_interspike%2Fcell_entry_on_6nk6_interspike.json&amp;ce=%255B%2522entry%2520in%2520293T_Mxra8%2520cells%2522%255D&amp;bc=%23cdc82d" target="_blank" rel="noreferrer">Cell entry on the <code>6nk6</code> structure showing the interspike contact mode</a></li></ul><h2 id="differences-in-effects-of-mutations-on-entry-in-different-cells" tabindex="-1">Differences in effects of mutations on entry in different cells <a class="header-anchor" href="#differences-in-effects-of-mutations-on-entry-in-different-cells" aria-label="Permalink to &quot;Differences in effects of mutations on entry in different cells&quot;">​</a></h2><p>Below is a visualization of the <strong>differences</strong> in effects of mutations on entry in two different cell lines on the trimer in <code>6nk7</code>. Click on the <em>Sidebar</em> and <em>Chart Options</em> to select which cell pair to show the differences for; click on the line plot to highlight sites on the structure. To view it in a standalone page (which may be easier to interact with), click <a href="https://dms-viz.github.io/v0/?data=https%3A%2F%2Fraw.githubusercontent.com%2Fdms-vep%2FCHIKV-181-25-E-DMS%2Frefs%2Fheads%2Fmain%2Fresults%2Fdms-viz%2Fcell_entry_diffs_on_6nk7_trimer%2Fcell_entry_diffs_on_6nk7_trimer.json&amp;ce=%255B%2522293T_Mxra8%2520minus%2520293T_TIM1%2522%255D&amp;bc=%23cbcd32" target="_blank" rel="noreferrer">here</a>.</p><iframe src="https://dms-viz.github.io/v0/?data=https%3A%2F%2Fraw.githubusercontent.com%2Fdms-vep%2FCHIKV-181-25-E-DMS%2Frefs%2Fheads%2Fmain%2Fresults%2Fdms-viz%2Fcell_entry_diffs_on_6nk7_trimer%2Fcell_entry_diffs_on_6nk7_trimer.json&amp;ce=%255B%2522293T_Mxra8%2520minus%2520293T_TIM1%2522%255D&amp;bc=%23cbcd32" width="100%" height="700px"></iframe><p>For additional visualizations, see:</p><ul><li><a href="https://dms-viz.github.io/v0/?data=https%3A%2F%2Fraw.githubusercontent.com%2Fdms-vep%2FCHIKV-181-25-E-DMS%2Frefs%2Fheads%2Fmain%2Fresults%2Fdms-viz%2Fcell_entry_diffs_on_6nk7_asymmetric_unit%2Fcell_entry_diffs_on_6nk7_asymmetric_unit.json&amp;ce=%255B%2522293T_Mxra8%2520minus%2520293T_TIM1%2522%255D&amp;bc=%23c3c534" target="_blank" rel="noreferrer">Cell entry differences on <code>6nk7</code> asymmetric unit</a></li><li><a href="https://dms-viz.github.io/v0/?data=https%3A%2F%2Fraw.githubusercontent.com%2Fdms-vep%2FCHIKV-181-25-E-DMS%2Frefs%2Fheads%2Fmain%2Fresults%2Fdms-viz%2Fcell_entry_diffs_on_6nk6_asymmetric_unit%2Fcell_entry_diffs_on_6nk6_asymmetric_unit.json&amp;ce=%255B%2522293T_Mxra8%2520minus%2520293T_TIM1%2522%255D&amp;bc=%23c3c534" target="_blank" rel="noreferrer">Cell entry differences on <code>6nk6</code> asymmetric unit</a></li></ul><h2 id="effects-of-mutations-on-mxra8-binding" tabindex="-1">Effects of mutations on Mxra8 binding <a class="header-anchor" href="#effects-of-mutations-on-mxra8-binding" aria-label="Permalink to &quot;Effects of mutations on Mxra8 binding&quot;">​</a></h2><p>Below is a visualization of the effects of mutations on Mxra8 binding on the trimer in <code>6nk7</code>. Click on the <em>Sidebar</em> and <em>Chart Options</em> tho select whether to show binding to mouse Mxra8 or human Mxra8. To view it on a standalone page (which may be easier to interact with), click <a href="https://dms-viz.github.io/v0/?data=https%3A%2F%2Fraw.githubusercontent.com%2Fdms-vep%2FCHIKV-181-25-E-DMS%2Frefs%2Fheads%2Fmain%2Fresults%2Fdms-viz%2Fmxra8_binding_on_6nk7_trimer%2Fmxra8_binding_on_6nk7_trimer.json&amp;pe=binding+to+mouse+Mxra8&amp;fi=%257B%2522entry_in_293T_Mxra8_cells%2522%253A-4%257D&amp;ce=%255B%2522binding%2520to%2520mouse%2520Mxra8%2522%255D&amp;bc=%23c1c33c" target="_blank" rel="noreferrer">here</a>.</p><iframe src="https://dms-viz.github.io/v0/?data=https%3A%2F%2Fraw.githubusercontent.com%2Fdms-vep%2FCHIKV-181-25-E-DMS%2Frefs%2Fheads%2Fmain%2Fresults%2Fdms-viz%2Fmxra8_binding_on_6nk7_trimer%2Fmxra8_binding_on_6nk7_trimer.json&amp;pe=binding+to+mouse+Mxra8&amp;fi=%257B%2522entry_in_293T_Mxra8_cells%2522%253A-4%257D&amp;ce=%255B%2522binding%2520to%2520mouse%2520Mxra8%2522%255D&amp;bc=%23c1c33c" width="100%" height="700px"></iframe><p>For additional visualizations, see:</p><ul><li><a href="https://dms-viz.github.io/v0/?data=https%3A%2F%2Fraw.githubusercontent.com%2Fdms-vep%2FCHIKV-181-25-E-DMS%2Frefs%2Fheads%2Fmain%2Fresults%2Fdms-viz%2Fmxra8_binding_on_6nk7_asymmetric_unit%2Fmxra8_binding_on_6nk7_asymmetric_unit.json&amp;pe=binding+to+mouse+Mxra8&amp;fi=%257B%2522entry_in_293T_Mxra8_cells%2522%253A-4%257D&amp;ce=%255B%2522binding%2520to%2520mouse%2520Mxra8%2522%255D&amp;bc=%23c1c33c" target="_blank" rel="noreferrer">Mxra8 binding on <code>6nk7</code> asymmetric unit</a></li><li><a href="https://dms-viz.github.io/v0/?data=https%3A%2F%2Fraw.githubusercontent.com%2Fdms-vep%2FCHIKV-181-25-E-DMS%2Frefs%2Fheads%2Fmain%2Fresults%2Fdms-viz%2Fmxra8_binding_on_6nk6_asymmetric_unit%2Fmxra8_binding_on_6nk6_asymmetric_unit.json&amp;pe=binding+to+mouse+Mxra8&amp;fi=%257B%2522entry_in_293T_Mxra8_cells%2522%253A-4%257D&amp;ce=%255B%2522binding%2520to%2520mouse%2520Mxra8%2522%255D&amp;bc=%23c1c33c" target="_blank" rel="noreferrer">Mxra8 binding on <code>6nk6</code> asymmetric unit</a></li></ul>',21)]))}const f=t(a,[["render",s]]);export{u as __pageData,f as default};
